    "long-lake-national-wildlife-refuge-january-february-march-april-1945-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Long Lake NWR
    outlines Refuge accomplishments from January through April of 1945. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    grazing, haying, and fur harvesting. The public relations section of the report
    describes Refuge visitors and Refuge participation. N-R forms and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
